=head1 NAME

Char::Prop::Unicode::5_1_0::BidiClass - Unicode 5.1.0 Bidi_Class property

=head1 SYNOPSIS

  use Char::Prop::Unicode::5_1_0::BidiClass;
  
  warn unicode_5_1_0_bidi_class_n 0x4E00;
  warn unicode_5_1_0_bidi_class_c "\x{4E00}";

=head1 DESCRIPTION

The C<Char::Prop::Unicode::5_1_0::BidiClass> module exports two
functions, C<unicode_5_1_0_bidi_class_n> and
C<unicode_5_1_0_bidi_class_c>, both return the value of Unicode
5.1.0 Bidi_Class property for the specified
character (or code position).  C<unicode_5_1_0_bidi_class_n>
accepts a number representing the code position, while
C<unicode_5_1_0_bidi_class_c> expects a (utf8-flagged) character,
as the first and only argument.

=head1 UNICODE VERSION

This module supports Unicode 5.1.0.



This module will I<not> be updated even when a newer version of
Unicode is released.



=head1 PROPERTY VALUES

The functions return one of following property values:

